/* eslint-disable react-hooks/exhaustive-deps */
import { Button } from "@material-ui/core";
import { useState } from "react";
import { useEffect } from "react";
import { useChats } from '../hooks/apiHooks';

interface propType {
    key: number,
    setThreadOpen: Function,
    setThreadId: Function,
}

const ThreadButton = ({ key, setThreadOpen, setThreadId }: propType) => {
    const { getThreadName } = useChats();
    const [name, setName] = useState('');

    useEffect(() => {
        (async () => {
            try {
                console.log('THREADBUTTON: ', key)
                const threadName = await getThreadName(key)
                console.log('THREADNAME: ', threadName)
                setName(threadName)
            } catch (e) {
                console.log(e.message);
            }
        })();
    }, []);

    const openThread = () => {
        setThreadOpen(true)
        setThreadId(key)
    }

    return (
        <>
            <Button onClick={openThread} color="primary" variant="contained">{name}</Button>
        </>
    )
}

export default ThreadButton
